VALUES ('7613033140495', 'Clinutren repair', 'Pour les besoins nutritionnels en cas de dénutrition ou risque de dénutritior Apporte des nutriments impliqués dans la cicatrisation (proline, arginine, vitamine bêta-carotène, vitamine E, vitamine C, zinc, sélénium). Avis important : Utiliser sou contrôle médical. Utiliser en complément de l\'alimentation. Utilisation et conser\',ü tion : A consommer de préférence frais. Non ouvert, conserver dans un endroit fra et sec. Après ouverture, refermer la bouteille entamée, conserver au réfrigérateur consommer dans les 24 heures. Dosage recommandé : Nutrition orale des patient de plus de 6 ans : 1 à 3 unités par jour en complémentation ou à adapter selon le recommandations médicales, à l\'âge, aux besoins et à l\'état du patient. Ingrédients Eau, protéines de lait, sirop de glucose, saccharose, huile de colza, acides aminé (L-proline, L-arginine), amidon, minéraux (citrate de potassium, phosphate sodium, chlorure de potassium, oxyde de magnésium, sulfate de zinc, pyrophos phate de fer, sulfate de manganèse, sulfate de cuivre, fluorure de sodium, chlorur( de chrome, sélénate de sodium, molybdate de sodium, iodure de potassium) vitamines (C, E, niacine, acide pantothénique, bêta-carotène, B6, BI, A, B2/ D, K acide folique, BI 2, biotine), émulsifiant (E471 ), épaississants (E41 8, E407), arômes Stérilisé UHT. Conditionné sous atmosphère protectrice. Sans gluten. Sans lactose', '', '3', '0.4', '16', '8', '0', '9', '0.3', '0.118110236220472', '', '1');

